import './App.css';
import { Route, Switch } from 'react-router-dom';
import Homepage from './pages/homepage/homepage.component';
import ShopPage from './pages/shop';
const HatsPage = ()  => {
  <div>
    <h1>HATS PAGE</h1>
  </div>
}

function App() {
  return (
    <Switch>
      <Route>
        <Homepage />
      </Route>
    </Switch>
  );
}

export default App;
